function App() {

	return (
		<>
			<div>

				{/* this Clock */}
				<Clock />
				<hr />

				{/* this Halu */}
				<Halu />

				{/* this error Boundary */}
				<ErrorBoundary>
					{/* isi props */}
					<Clock />
				</ErrorBoundary>
			</div>
		</>
	);
}

export default App;
